// import './App.css';
import { Header } from './Header';
import { Main } from './Main';
import { Footer } from './Footer';

function App() {
  return (
    <>
      <body className="page">
        <Header />
        <Main />
        <Footer />
      </body>
    </>
  );
}

export default App;
